import React from 'react'

const Person = ({ name }) => <div>{name} </div>;

const Persons = ({ persons }) => {
  console.log('Person name:', persons)
  return (
    <div>
      {persons.map(person => 
        <Person key={person.name} name={person.name} number={person.number}/>)}
    </div>
  )
};

export default Persons;
